import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Focus and type a partial search term to trigger autocomplete
    await page.click('#searchInput');
    await page.type('#searchInput', 'iph');

    // Wait for the search suggestions dropdown to appear
    await page.waitForSelector('#searchSuggestions', { timeout: 5000 });

    // Take screenshot of the suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract the suggestion items
    const suggestions = await page.$$eval('#searchSuggestions .suggestion-item', els =>
      els.map(el => el.textContent.trim())
    );

    // Click the first suggestion if available
    if (suggestions.length > 0) {
      await page.click('#searchSuggestions .suggestion-item');
      // Wait for search results to render (look for .search-results or .results-count)
      await page.waitForSelector('.search-results, .results-count', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));
    }

    // Extract the current value of the search input after suggestion click
    const searchInputValue = await page.$eval('#searchInput', el => el.value);

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected a suggestion, and verified search results.",
      extractedData: {
        suggestions,
        searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
